import{_ as e,o as t,c as i,O as n}from"./chunks/framework.9482e208.js";const p=JSON.parse('{"title":"§ 23.1-639 Definition; construction of section.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/23.1-639.md","filePath":"vacode/23.1-639.md"}'),o={name:"vacode/23.1-639.md"},a=n('<h1 id="§-23-1-639-definition-construction-of-section" tabindex="-1">§ 23.1-639 Definition; construction of section. <a class="header-anchor" href="#§-23-1-639-definition-construction-of-section" aria-label="Permalink to &quot;§ 23.1-639 Definition; construction of section.&quot;">​</a></h1><p>A. As used in this article, &quot;senior citizen&quot; means any individual who, before the beginning of any academic term, semester, or quarter in which he claims entitlement to the benefits of this article, has reached the age of 60 and has been legally domiciled in the Commonwealth for at least one year.</p><p>B. Nothing in this section shall be construed to exclude any other rules and requirements made by any public institution of higher education for all other students besides senior citizens with respect to domicile in the Commonwealth.</p><p>1974, c. 463, § 23-38.55; 1976, c. 19; 1977, c. 281; 2002, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?021+ful+CHAP0521" target="_blank" rel="noreferrer">521</a>; 2003, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?031+ful+CHAP0700" target="_blank" rel="noreferrer">700</a>; 2016, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?161+ful+CHAP0588" target="_blank" rel="noreferrer">588</a>.</p>',4),r=[a];function c(s,l,h,d,f,_){return t(),i("div",null,r)}const m=e(o,[["render",c]]);export{p as __pageData,m as default};
